-- all_in_one / toute les tables en une seule table
CREATE TABLE all_in_one (
   id SERIAL UNIQUE NOT NULL,
   code_region VARCHAR(4)  NOT NULL, 
   capital_region VARCHAR(10) NOT NULL, -- REFERENCES Towns (code),
   name_region TEXT NOT NULL,

   code_departement VARCHAR(4)  NOT NULL, -- Not always numeric, for instance Corsica 
                                  -- with 2A and 2B
   capital_departement VARCHAR(10)  NOT NULL, -- REFERENCES Towns (code), 
             -- Actually, it is the concatenation of D.code + T.code.
--   region VARCHAR(4) NOT NULL REFERENCES Regions (code),
   name_departement TEXT  NOT NULL,

   code_town VARCHAR(10) NOT NULL, -- Only unique inside a department
   article TEXT,
   name_town TEXT NOT NULL -- Names are not really unique, for instance 'Sainte-Croix'
  -- department VARCHAR(4) NOT NULL REFERENCES Departments (code),
  -- UNIQUE (code, department)
   -- UNIQUE (name, department) -- Not perfectly unique but almost

);

